import React from 'react';
import './App.css';
import { useState } from 'react';

function App() {
  const [count, setCount] = useState(0);
  function increment() {
    if (count < 10) {
      setCount(count + 1)
    }

  }
  function decrement() {
    if (count > 0) {
      setCount(count - 1)
    }

  }
  return (
    <div className="App">
      <h1>{count}</h1>
      <button onClick={increment}>Increment</button>
      <button onClick={decrement}>Decrement</button>
      <input type='color'>Chose y</input>
    </div>
  );
}

export default App;
